Creates a new {@linkplain Distance} which represents the sum of
this {@linkplain Distance} and the parameter (this + that).
<p>
Neither this distance nor the parameter are modified.
@param distance The {@linkplain Distance} to add.
@return A new {@linkplain Distance} which represents (this + that).

Creates a new distance which represents the difference of this 
{@linkplain Distance} and the parameter (this - that).
<p>
Neither this {@linkplain Distance} nor the parameter are modified.
@param distance The {@linkplain Distance} to subtract.
@return A new {@linkplain Distance} which represents (this - that).

Creates a new {@linkplain Distance} which represents this 
{@linkplain Distance} divided by a scalar value (this / scalarValue).
This {@linkplain Distance} is not modified.  
<p>
A typical usage of this would be in a formula that requires a {@linkplain Distance}; 
for instance, the computing half the distance distance traveled.  In this case, the
total distance is a {@linkplain Distance}, the scalar value being divided is 2, and 
the return value is the half the total distance.
@param scalarValue The scalar value to divide this {@linkplain Distance} by.
@return A new {@linkplain Distance} which represents (this / scalarValue).

Returns a new {@linkplain Angle} which represents the sum of this 
angular distance and the parameter (this + that).
<p>
Neither this {@linkplain Angle} nor the parameter are modified.
@param angle The {@linkplain Angle} to add to this {@linkplain Angle}.
@return A new {@linkplain Angle} which represents (this + that).

Returns a new {@linkplain Angle} which represents the difference of this 
angular distance and the parameter (this - that).
<p>
Neither this angle nor the parameter are modified.
@param angle The {@linkplain Angle} to subtract from this {@linkplain Angle}.
@return A new {@linkplain Angle} which represents (this - that).
